  false,\n\t\"url\": null,\n\t\"notes\": \"This plan is intended to set guidelines
  for the selection, conversion techniques, assignment of priorities and post treatment
  evaluation of non-forested areas that would support reestablished bottomland hardwood
  timber stands. The plan is for a period of five years after which the results will
  be examined. If the results are positive and more areas are available, the plan
  can be revised and continued for an additional period of time.\",\n\t\"license_title\":
